import React from 'react';
import './App.css';

import { Route} from 'react-router-dom';
import Login from './containers/Authentication/Login/Login'


const App = () => {
  return (
    <div>
      <Route exact path="/login" component={Login}/>
    </div>
  )
}

export default App;
